import React from 'react'

const Navbar = () => {
  return (
    <div>
        <nav className="navbar">
        <h1>The Dojo Blog</h1>
        <div className="links">
          <Link to="/">Home</Link>
          <Link to="/create" style={{
            color:"white",
            backgroundColor:"#f1356d",
            borderRadius:"8px"
          }}>new blog</Link>
        </div>
      </nav>
    </div>
  )
}

export default Navbar
